import React from 'react';
import s from './User.module.css';


const User = (props) => {
return(
    <div className={s.wrapper}>
        <div><img src={props.ava}/></div>
        <div>{props.followed}</div>
        <div>{props.status}</div>
        <div>{props.location.country}</div>
        <div>{props.fullName.city}</div>

    </div>
)

}

export default User;
